import React from 'react';

import './Events.css';

function Events(props) {
  return (
    <li className={'events'}>
      <h2>{props.name}</h2>
      <h3>{props.startDate}</h3>
      <p>{props.view}</p>
      <iframe src='https://www.youtube.com/embed/cWDJoK8zw58'></iframe>
    </li>
  );
}

export default Events;
